%pyspark
from matplotlib import pyplot as plt
import seaborn as sns
import numpy as np
import pandas as pd

udf_dt2dh = udf(lambda d, t: d + ' ' + t[:-3])
udf_dt2dh_ = udf(lambda dt: dt[:-3])
udf_dh2d = udf(lambda dh: dh.split(' ')[0])
udf_dh2h = udf(lambda dh: int(dh.split(' ')[1]), IntegerType())
udf_ymd2ym = udf(lambda ymd: ymd[:-3])
udf_joule = udf(lambda f: float(f)*60, DoubleType())

def classifyPm10(pm):
    if pm <= 30:
        return 1
    elif 30 < pm <= 80:
        return 2
    elif 80 < pm <= 150:
        return 3
    else:
        return 4

def classifyPm25(pm):
    if pm <= 15:
        return 1
    elif 15 < pm <= 35:
        return 2
    elif 35 < pm <= 75:
        return 3
    else:
        return 4

udf_classifyPm10 = udf(classifyPm10, IntegerType())
udf_classifyPm25 = udf(classifyPm25, IntegerType())

def selectDatehourNcol(df, col):
    return df.withColumn('datehour', udf_dt2dh(df.date, df.time))\
             .select('datehour', col)


def showCorrMtx(df):
    pdf = df.toPandas()
    corr = pdf.corr()
    mask = np.zeros_like(corr)
    mask[np.triu_indices_from(mask)] = True
    ax = plt.subplots(figsize=(11,11))
    ax = sns.heatmap(corr, annot=True, mask=mask,
                     cmap="YlGnBu")

def showBoxplot(df, x, y):
    xlist = []
    for i in range(1, 5):
        a = df.select(y).where(x + ' = ' + str(i)).collect()
        xlist.append(a)
    plt.boxplot(xlist)

def alterColNameBrackets(df):
    cols = df.columns
    for col in cols:
        if '(' in col:
            rep = col.replace('(', '_').replace(')', '')
            df = df.withColumnRenamed(col, rep)
    return df
